const TodoList = ({ text, todos }) => {
    return (
        <form>
            <div className="todoList">
                <div className="todoElement">{todos.map((todo, index) => {
                    <div>{todo.title}</div>
                })}</div>
            </div>
        </form>
    )
}

export default TodoList;
